import Banner from './Banner'
import "./HomeScreen.css"
import Nav from './Nav'

function HomeScreen() {
  return (
    <div className="homeScreen">
      {/* Nav */}
      <Nav/>

      {/* Banner */}
      <Banner/>

      {/* Row */}
      {/* Each row will take a few different props */}
      {/* Props allow us to customise  */}
      <Row/>
      <Row/>
      <Row/>
      <Row/>
      <Row/>
    </div>
  )
}

export default HomeScreen
